title:
Сезон 1 на &quot;Досиетата Грим&quot; оправдава очакванията на хората за един сериал с постоянно напрежение, множество приказни герои и неочаквани обрати.

Ето няколко мнения за първия сезон:

&quot;Сериалът е страхотен! Заслужава си гледането, а и има какво да се види! Има потенциал!  +5&quot;
&quot;Много ми е странно как оставят края на епизодите с отворен край  и не дават как полицайте си обясняват накои от случаите. Напр. епизода с жената паяк, как си обясняват че ги е убивала и че пръста й не е отрязан и как че я намират стара на др ден??&quot;
&quot;Сериалът е уникален! Изключителна смесица между митология и модерния живот! &quot;
&quot;Сериала е добър. Ще се заредя с търпение за следващия сезон.&quot;
&quot;Сериалът е много хубав и показва донякъде истинските истории на оригиналните Братя Грим, а не художествената измислица.... евала за това!!!&quot;
&quot;Сериала е уникален! Актьорите са много симпатични и добре подбрани&quot;
&quot;Чудно прекрасна поредица! Гледах до припадък по цяла нощ с огромно удоволствие. Отдавна не бях се натъквала на така  интересни и хубаво направени филми.&quot;
&quot;Този Грим е крайно време да вземе няколко урока за убиване на свръхестествени гадинки от Професионалистите. Шегувам се, сериалчето има своите силни страни, става за разтоварващо гледане и историите са интересни.&quot;
&quot;Честно да ви кажа, току що изгледах първа серия и по мое мнение филмът си е много добър, грабва от 1-ва минута и действието е нон стоп, има динамика и е оригинален, 5-ца без да се замислям. Ще гледам натам и ще коментирам пак.&quot;
&quot;Сериала е много добър. Търсих си нещо ново за гледане и случайно го намерих, предположих, че ще ми хареса и се оказах права. Много бързо свърших с 1ви сезон, сега съм на 2ри и честно казано, гледам ги адски бързо. Просто много зарибява и затова не се чудете и теглете. Пожелавам ви приятно гледане!&quot;
&quot;Готино е сериалчето, бая зарибява, а и Сайлъс Уеър Мичъл допринася доста&quot;

